import React from 'react';

const FaceRecognition = ({imageURL}) => {
	return(
		<div className='mt2'>
				<img id='inputimage' src={imageURL} width="500px" height='auto'alt="error"/>	
		</div>
	);

}

export default FaceRecognition;
